from collections import defaultdict


class Point:
    def __init__(self, x, y):
        self.x = x
        self.y = y

    def __sub__(self, other):
        return Point(self.x - other.x, self.y - other.y)

    def __add__(self, other):
        return Point(self.x + other.x, self.y + other.y)

    def __mul__(self, k):
        return Point(self.x * k, self.y * k)

    def __div__(self, k):
        return Point(self.x / k, self.y / k)

    def __hash__(self):
        return hash((self.x, self.y))

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y

    def __str__(self):
        return 'Point(%s, %s)' % (self.x, self.y)

    def __repr__(self):
        return 'Point(%s, %s)' % (self.x, self.y)


class Circle:
    def __init__(self, p, r):
        self.p = p
        self.r = r

    def __str__(self):
        return 'Circle(%s, %s)' % (self.p, self.r)

    def __repr__(self):
        return 'Circle(%s, %s)' % (self.p, self.r)

    def __hash__(self):
        return hash((self.p, self.r))

    def __eq__(self, other):
        return self.p == other.p and self.r == other.r

    def area(self):
        return math.pi * self.r * self.r

    def contains(self, p):
        return self.p.distance(p) <= self.r

    def distance(self, p):
        return self.p.distance(p) - self.r

    def intersects(self, other):
        return self.distance(other.p) < self.r + other.r

    def merge(self, other):
        p = Point((self.p.x + other.p.x) / 2.0, (self.p.y + other.p.y) / 2.0)
        r = self.r + other.r
        return Circle(p, r)

    def move(self, v):
        return Circle(self.p + v, self.r)

    def velocity(self):
        return self.p - self.p


def merge(circles):
    if len(circles) == 0:
        return []
    if len(circles) == 1:
        return circles
    circles.sort(key=lambda c: c.p.x)
    new_circles = []
    i = 0
    while i < len(circles):
        for j in range(i + 1, len(circles)):
            if circles[i].intersects(circles[j]):
                new_circles.append(circles[i].merge(circles[j]))
                break
        else:
            new_circles.append(circles[i])
        i += 1
    return new_circles


def find_collisions(circles):
    collisions = []
    i = 0
    while i < len(circles):
        for j in range(i + 1, len(circles)):
            if circles[i].intersects(circles[j]):
                collisions.append((i, j))
        i += 1
    return collisions


