import math


def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)


def solve():
    n = int(input())
    gears = []
    for _ in range(n):
        x, y, r = map(int, input().split())
        gears.append((x, y, r))

    def get_neighbors(gear_index):
        neighbors = []
        x, y, r = gears[gear_index]
        for i in range(n):
            if i != gear_index:
                xi, yi, ri = gears[i]
                distance = math.sqrt((xi - x) ** 2 + (yi - y) ** 2)
                if distance == 2 * r:
                    neighbors.append(i)
        return neighbors

    def get_rotation_ratio(gear_index, target_index):
        neighbors = get_neighbors(gear_index)
        target_neighbors = get_neighbors(target_index)
        common_neighbors = set(neighbors).intersection(target_neighbors)
        if not common_neighbors:
            return None
        common_neighbors = list(common_neighbors)
        num = gears[common_neighbors[0]][2]
        den = gears[common_neighbors[0]][2]
        for neighbor in common_neighbors:
            num = num * gears[neighbor][2] // gcd(num, gears[neighbor][2])
            den = den * gears[neighbor][2] // gcd(den, gears[neighbor][2])
        return num, den

    source_index = 0
    target_index = n - 1
    rotation_ratio = get_rotation_ratio(source_index, target_index)
    if not rotation_ratio:
        print('-1')
    else:
        num, den = rotation_ratio
        print(f'{num} {den}')


