    def is_tree(edges, n):
        adj = [[] for _ in range(n)]
        for i in range(n):
            for j in range(i + 1, n):
                l1, r1 = edges[i]
                l2, r2 = edges[j]
                if not (l1 < l2 < r1 <= r2 or l2 < l1 < r2 <= r1):
                    adj[i].append(j)
                    adj[j].append(i)

        def dfs(node, parent, visited):
            visited[node] = True
            for neighbor in adj[node]:
                if not neighbor == parent:
                    if not visited[neighbor]:
                        dfs(neighbor, node, visited)
                    else:
                        return False
            return True

        visited = [False] * n
        if not dfs(0, -1, visited):
            return False
        for i in range(n):
            if not visited[i]:
                return False
        return True

    if not is_tree(edges, n):
        print('NO')
