        new_pumpkins = []
        for r, c in pumpkins:
            neighbors = get_neighbors(r, c)
            if len(neighbors) > 0:
                for nr, nc in neighbors:
                    if (nr, nc) in pumpkins:
                        new_pumpkins.append((r, c))
                        new_pumpkins.append((nr, nc))
                        break
            else:
                new_pumpkins.append((r, c))
        return new_pumpkins

    for day in range(D + 1):
        if day == D:
            for r, c in pumpkins:
                if is_valid(r, c):
                    print('ALIVE')
                else:
                    print(day)
