        start = None
        end = None
        for i in range(h):
            for j in range(w):
                if grid[i][j] == 'S':
                    start = (i, j)
                elif grid[i][j] == 'T':
                    end = (i, j)
        return start, end

    start, end = find_start_and_end(grid)

    def is_valid(x, y):
        return 0 <= x < h and 0 <= y < w

    def get_neighbors(x, y):
        neighbors = []
        for dx in [-1, 0, 1]:
            for dy in [-1, 0, 1]:
                if dx == 0 and dy == 0:
                    continue
                nx = x + dx
                ny = y + dy
                if is_valid(nx, ny):
                    neighbors.append((nx, ny))
        return neighbors

    def bfs(start, end):
        queue = [start]
        visited = set()
        visited.add(start)
        while queue:
            x, y = queue.pop(0)
            if (x, y) == end:
                return True
            neighbors = get_neighbors(x, y)
            for nx, ny in neighbors:
                if (nx, ny) not in visited:
                    visited.add((nx, ny))
                    queue.append((nx, ny))
        return False

    def remove_leaves(start, end):
        removed = 0
        for i in range(h):
            for j in range(w):
                if grid[i][j] == 'o':
                    new_grid = [row[:] for row in grid]
                    new_grid[i][j] = '.'
                    if bfs(start, end):
                        removed += 1
                    else:
                        new_grid[i][j] = 'o'
        return removed

    removed = remove_leaves(start, end)
    if removed == 0:
        print(-1)
    else:
