    a = []
    for _ in range(n):
        a.append(list(map(int, input().split())))
    dp = {}

    def calculate_xor(current_row, current_col, current_xor):
        if (current_row, current_col, current_xor) in dp:
            return dp[(current_row, current_col, current_xor)]
        if current_row == n - 1 and current_col == m - 1:
            if current_xor == a[n - 1][m - 1]:
                return 1
            else:
                return 0
        paths = 0
        if current_row + 1 <= n - 1:
            paths += calculate_xor(current_row + 1, current_col, current_xor ^
                a[current_row + 1][current_col])
        if current_col + 1 <= m - 1:
            paths += calculate_xor(current_row, current_col + 1, current_xor ^
                a[current_row][current_col + 1])
        dp[(current_row, current_col, current_xor)] = paths
        return paths
    print(calculate_xor(0, 0, 0))


